import React from "react";
import { Link } from "react-router-dom";

const navLinks = [
  { path: "/", label: "home" },
  { path: "/", label: "home" },
  { path: "/", label: "home" },
];

const NavBar = () => {
  return (
    <nav className="nav">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/products">Product</Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
